import{_ as i,p as l,q as e,a1 as n}from"./framework-8fa3e4ce.js";const a={},T=n(`<h1 id="http-状态码" tabindex="-1"><a class="header-anchor" href="#http-状态码" aria-hidden="true">#</a> HTTP - 状态码</h1><h2 id="常用" tabindex="-1"><a class="header-anchor" href="#常用" aria-hidden="true">#</a> 常用</h2><ol><li>状态码分类</li></ol><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>1xx 服务器收到请求
2xx 请求成功，如200
3xx 重定向，如302
4xx 客户端错误，如404
5xx 服务端错误，如500
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><ol start="2"><li>常见状态码</li></ol><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>200 成功
301 永久重定向（配合location，浏览器自动处理)
302 临时重定向（配合location，浏览器自动处理)
304 资源未被修改
404 资源未找到
403 没有权限
500 服务器错误
504 网关超时
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h2 id="全部" tabindex="-1"><a class="header-anchor" href="#全部" aria-hidden="true">#</a> 全部</h2><ul><li><p>1**(信息类)：表示接收到请求并且继续处理</p><ul><li>100——客户必须继续发出请求</li><li>101——客户要求服务器根据请求转换HTTP协议版本</li></ul></li><li><p>2**(响应成功)：表示动作被成功接收、理解和接受</p><ul><li>200——表明该请求被成功地完成，所请求的资源发送回客户端</li><li>201——提示知道新文件的URL</li><li>202——接受和处理、但处理未完成</li><li>203——返回信息不确定或不完整</li><li>204——请求收到，但返回信息为空</li><li>205——服务器完成了请求，用户代理必须复位当前已经浏览过的文件</li><li>206——服务器已经完成了部分用户的GET请求</li></ul></li><li><p>3**(重定向类)：为了完成指定的动作，必须接受进一步处理</p><ul><li>300——请求的资源可在多处得到</li><li>301——本网页被永久性转移到另一个URL</li><li>302——请求的网页被转移到一个新的地址，但客户访问仍继续通过原始URL地址，重定向，新的URL会在response中的Location中返回，浏览器将会使用新的URL发出新的Request。</li><li>303——建议客户访问其他URL或访问方式</li><li>304——自从上次请求后，请求的网页未修改过，服务器返回此响应时，不会返回网页内容，代表上次的文档已经被缓存了，还可以继续使用</li><li>305——请求的资源必须从服务器指定的地址得到</li><li>306——前一版本HTTP中使用的代码，现行版本中不再使用</li><li>307——申明请求的资源临时性删除</li></ul></li><li><p>4**(客户端错误类)：请求包含错误语法或不能正确执行</p><ul><li>400——客户端请求有语法错误，不能被服务器所理解</li><li>401——请求未经授权，这个状态代码必须和WWW-Authenticate报头域一起使用 <ul><li>HTTP 401.2 - 未授权：服务器配置问题导致登录失败</li><li>HTTP 401.3 - ACL 禁止访问资源</li><li>HTTP 401.4 - 未授权：授权被筛选器拒绝</li><li>HTTP 401.5 - 未授权：ISAPI 或 CGI 授权失败</li></ul></li><li>402——保留有效ChargeTo头响应</li><li>403——禁止访问，服务器收到请求，但是拒绝提供服务 <ul><li>HTTP 403.1 禁止访问：禁止可执行访问</li><li>HTTP 403.2 - 禁止访问：禁止读访问</li><li>HTTP 403.3 - 禁止访问：禁止写访问</li><li>HTTP 403.4 - 禁止访问：要求 SSL</li><li>HTTP 403.5 - 禁止访问：要求 SSL 128</li><li>HTTP 403.6 - 禁止访问：IP 地址被拒绝</li><li>HTTP 403.7 - 禁止访问：要求客户证书</li><li>HTTP 403.8 - 禁止访问：禁止站点访问</li><li>HTTP 403.9 - 禁止访问：连接的用户过多</li><li>HTTP 403.10 - 禁止访问：配置无效</li><li>HTTP 403.11 - 禁止访问：密码更改</li><li>HTTP 403.12 - 禁止访问：映射器拒绝访问</li><li>HTTP 403.13 - 禁止访问：客户证书已被吊销</li><li>HTTP 403.15 - 禁止访问：客户访问许可过多</li><li>HTTP 403.16 - 禁止访问：客户证书不可信或者无效</li><li>HTTP 403.17 - 禁止访问：客户证书已经到期或者尚未生效</li></ul></li><li>404——一个404错误表明可连接服务器，但服务器无法取得所请求的网页，请求资源不存在。eg：输入了错误的URL</li><li>405——用户在Request-Line字段定义的方法不允许</li><li>406——根据用户发送的Accept拖，请求资源不可访问</li><li>407——类似401，用户必须首先在代理服务器上得到授权</li><li>408——客户端没有在用户指定的饿时间内完成请求</li><li>409——对当前资源状态，请求不能完成</li><li>410——服务器上不再有此资源且无进一步的参考地址</li><li>411——服务器拒绝用户定义的Content-Length属性请求</li><li>412——一个或多个请求头字段在当前请求中错误</li><li>413——请求的资源大于服务器允许的大小</li><li>414——请求的资源URL长于服务器允许的长度</li><li>415——请求资源不支持请求项目格式</li><li>416——请求中包含Range请求头字段，在当前请求资源范围内没有range指示值，请求也不包含If-Range请求头字段</li><li>417——服务器不满足请求Expect头字段指定的期望值，如果是代理服务器，可能是下一级服务器不能满足请求长。</li></ul></li><li><p>5**(服务端错误类)：服务器不能正确执行一个正确的请求</p><ul><li>HTTP 500 - 服务器遇到错误，无法完成请求 <ul><li>HTTP 500.100 - 内部服务器错误 - ASP 错误</li><li>HTTP 500-11 服务器关闭</li><li>HTTP 500-12 应用程序重新启动</li><li>HTTP 500-13 - 服务器太忙</li><li>HTTP 500-14 - 应用程序无效</li><li>HTTP 500-15 - 不允许请求 global.asa</li></ul></li><li>Error 501 - 未实现</li><li>HTTP 502 - 网关错误</li><li>HTTP 503：由于超载或停机维护，服务器目前无法使用，一段时间后可能恢复正常</li></ul></li></ul>`,8),d=[T];function s(t,r){return l(),e("div",null,d)}const u=i(a,[["render",s],["__file","HTTP状态码.html.vue"]]);export{u as default};
